import logo from "../../assets/tmu_logo.svg";
import "./Signup.css";

function Signup() {
  return (
    <>
      <div className="signup-component main-wrap1">
        <main className="signup">
          <div className="img-wrap">
            <img className="" src={logo} alt="TMU Logo" width={100} height={100} />
          </div>
          <h1 className="sitename">UniFynd</h1>
          <form className="signup">
            {/* name w/ first and last being side-to-side*/}
            <div className="names">
              <input className="name firstName" type="text" placeholder="First Name" />
              <input className="name lastName" type="text" placeholder="Last Name" />
            </div>

            {/* email */}
            <input className="email" type="email" placeholder="Email" />
            {/* password */}
            <input className="password" type="password" placeholder="Password" />
            {/* confirm password */}
            <input className="confirm-password" type="password" placeholder="Confirm Password" />
            {/* signup button */}
            <button className="signup-btn">Sign Up</button>
          </form>
        </main>
      </div>
    </>
  );
}

export default Signup;
